pFoundException$Message' => NULL, 'AssociatedListenerFoundException$Message' => NULL, 'ByoipCidrNotFoundException$Message' => NULL, 'ConflictException$Message' => NULL, 'EndpointAlreadyExistsException$Message' => NULL, 'EndpointGroupAlreadyExistsException$Message' => NULL, 'EndpointGroupNotFoundException$Message' => NULL, 'EndpointNotFoundException$Message' => NULL, 'IncorrectCidrStateException$Message' => NULL, 'InternalServiceErrorException$Message' => NULL, 'InvalidArgumentException$Message' => NULL, 'InvalidNextTokenException$Message' => NULL, 'InvalidPortRangeException$Message' => NULL, 'LimitExceededException$Message' => NULL, 'ListenerNotFoundException$Message' => NULL, ], ], 'GenericBoolean' => [ 'base' => NULL, 'refs' => [ 'Accelerator$Enabled' => '<p>Indicates whether the accelerator is enabled. The value is true or false. The default value is true. </p> <p>If the value is set to true, the accelerator cannot be deleted. If set to false, accelerator can be deleted.</p>', 'AcceleratorAttributes$FlowLogsEnabled' => '<p>Indicates whether flow logs are enabled. The default value is false. If the value is true, <code>FlowLogsS3Bucket</code> and <code>FlowLogsS3Prefix</code> must be specified.</p> <p>For more information, see <a href="https://docs.aws.amazon.com/global-accelerator/latest/dg/monitoring-global-accelerator.flow-logs.html">Flow Logs</a> in the <i>AWS Global Accelerator Developer Guide</i>.</p>', 'AllowCustomRoutingTrafficRequest$AllowAllTrafficToEndpoint' => '<p>Indicates whether all destination IP addresses and ports for a specified VPC subnet endpoint can receive traffic from a custom routing accelerator. The value is TRUE or FALSE. </p> <p>When set to TRUE, <i>all</i> destinations in the custom routing VPC subnet can receive traffic. Note that you cannot specify destination IP addresses and ports when the value is set to TRUE.</p> <p>When set to FALSE (or not specified), you <i>must</i> specify a list of destination IP addresses that are allowed to receive traffic. A list of ports is optional. If you don\'t specify a list of ports, the ports that can accept traffic is the same as the ports configured for the endpoint group.</p> <p>The default value is FALSE.</p>', 'CreateAcceleratorRequest$Enabled' => '<p>Indicates whether an accelerator is enabled. The value is true or false. The default value is true. </p> <p>If the value is set to true, an accelerator cannot be deleted. If set to false, the accelerator can be deleted.</p>', 'CreateCustomRoutingAcceleratorRequest$Enabled' => '<p>Indicates whether an accelerator is enabled. The value is true or false. The default value is true. </p> <p>If the value is set to true, an accelerator cannot be deleted. If set to false, the accelerator can be deleted.</p>', 'CustomRoutingAccelerator$Enabled' => '<p>Indicates whether the accelerator is enabled. The value is true or false. The default value is true. </p> <p>If the value is set to true, the accelerator cannot be deleted. If set to false, accelerator can be deleted.</p>', 'CustomRoutingAcceleratorAttributes$FlowLogsEnabled' => '<p>Indicates whether flow logs are enabled. The default value is false. If the value is true, <code>FlowLogsS3Bucket</code> and <code>FlowLogsS3Prefix</code> must be specified.</p> <p>For more information, see <a href="https://docs.aws.amazon.com/global-accelerator/latest/dg/monitoring-global-accelerator.flow-logs.html">Flow Logs</a> in the <i>AWS Global Accelerator Developer Guide</i>.</p>', 'DenyCustomRoutingTrafficRequest$DenyAllTrafficToEndpoint' => '<p>Indicates whether all destination IP addresses and ports for a specified VPC subnet endpoint <i>cannot</i> receive traffic from a custom routing accelerator. The value is TRUE or FALSE. </p> <p>When set to TRUE, <i>no</i> destinations in the custom routing VPC subnet can receive traffic. Note that you cannot specify destination IP addresses and ports when the value is set to TRUE.</p> <p>When set to FALSE (or not specified), you <i>must</i>